import React from 'react';
import Card from '../Card/Card';
import classes from '.'
function UsersList(props){
    return(<>
    <Card>
        {props.users.map((user, index) => (
          <li key={index}>
            Username: {user.userName}, Age: {user.age}
          </li>
        ))}
        </Card>
        </>)
};
export default UsersList;
